spring:
  cloud:
    gateway:
      enabled: false
      redis:
        enabled: false
  mustache:
    check-template-location: false
  codec:
    multipart:
      enabled: true
      max-parts: -1
      max-size: -1B
logging:
  level:
    root: WARN
    org:
      springframework: INFO
google:
  bucket:
    name: '{cipher}'
  credentials:
    path: '{cipher}'
  project:
    id: '{cipher}'
eureka:
  client:
    serviceUrl:
      defaultZone: http://service-registry:8761/eureka/